function App() {

  {
    activeLink === "webDev&Des" && (
    fillProjects()
    );
  }

  return (
    <div>
      <Menu  />
      {projects}
      <Introduction />
    </div>
  );
}

function fillProjects(){
  const projects = webDevNDes.map(project => (
    <Project 
    name={project.name}
      date={project.date}
      role = {project.role}
      description = {project.description}
      link={project.link}
    />
  ));
}


export default App;
